import React, { Component } from "react";

export default class datum extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [],
    };
  }
  componentDidMount() {
    fetch("https://gtla6-covidtracker.herokuapp.com/")
      .then((res) => res.json())
      .then((jsonData) => {
        this.setState({
          isLoaded: true,
          data: jsonData,
        });
      });
  }
  render() {
    const { data } = this.state;
    console.log(typeof data);
    return (
      <>
        <div className="container">
        <div className="row justify-content-between">
          <div className="global-data">
            <div className="col-2 box">
              <p>Total Cases <i class="fa fa-arrow-circle-up icons"></i></p>
              <p className="counterPara">{data.cases}</p>
            </div>
            <div  className="col-2 box">
              <p>Active Cases <i class="fa fa-arrow-circle-up icons"></i></p>
              <p className="counterPara">{data.active}</p>
            </div>
            <div className="col-2 box">
              <p>Recovered <i class="fa fa-arrow-circle-up icons"></i></p>
              <p className="counterPara">{data.recovered}</p>
            </div>
            <div className="col-2 box">
              <p>Dea <i class="fa fa-arrow-circle-up icons"></i></p>
              <p className="counterPara">{data.deaths}</p>
            </div>
          </div>
        </div>
        </div>
      </>
    );
  }
}
